(9020, 'laclede, 1 lt wall sconce', NULL, 'Elegáns és drámai hatást keltő, gyönyörű kollekció, melynek jellegzetessége a toszkán bronz kidolgozású, csiszolt ezüst díszítésű váz és a texturált, bordázott Scavo üveg búra, lágy élekkel.', 10, '2012-06-07 12:25:26', '2012-06-07 14:07:56', '22480', 43740, 2, NULL, 'laclede-1-lt-wall-sconce', NULL, NULL, 1),
(9021, 'vitalia, 1 lt wall sconce', NULL, 'Kézzel kovácsolt, olajfényű bronz fém váz, öleli körül, a nehéz, kézzel készült borostyán színű üvegbúrákat, melyek tonalitása kulcsfontosságú szerepet játszik az anyagok izgalmas keveredésében.', 10, '2012-06-07 12:25:26', '2012-06-07 14:07:56', '22481', 55890, 4, NULL, 'vitalia-1-lt-wall-sconce', NULL, NULL, 1),
(9022, 'toulouse, 1 lt wall sconce', NULL, 'Az aprólékosan kidolgozott kézzel kovácsolt vas váz és egyedi üvegbúrák adják a báját ennek a lámpacsaládnak, mely tökéletes választás azok számára, akik értékelik a finom kivitelezést.', 10, '2012-06-07 12:25:26', '2012-06-07 14:07:56', '22482', 47790, 4, NULL, 'toulouse-1-lt-wall-sconce', NULL, NULL, 1),
(9023, 'gelati, 1 lt wall sconce', NULL, 'Gazdag, mégis rusztikus megjelenésű lámpa, enyhén antikolt kovácsolt bronz vázzal, matt fekete díszítéssel és a szemcsés üvegbúrákat tartó rácsokkal.', 10, '2012-06-07 12:25:27', '2012-06-07 14:07:57', '22483', 47790, 4, NULL, 'gelati-1-lt-wall-sconce', NULL, NULL, 1),
(9024, 'brandon, 1 lt wall sconce', NULL, 'Kristályokkal díszített, nikkelezettt, modern, absztrakt kialakítású fém váz, mely körülöleli a pezsgőszínű szövet vagy foltos tejüveg lámpabúrát.', 10, '2012-06-07 12:25:27', '2012-06-07 14:07:57', '22484', 51030, 4, NULL, 'brandon-1-lt-wall-sconce', NULL, NULL, 1),
(9025, 'andros, 1 lt wall sconce', NULL, 'Erős lineáris szerkezet és egyszerű mű-alabástrom lámpabúrák, melyek ötvözete friss, átmeneti kinézetet kölcsönöz a lámpacsaládnak.', 10, '2012-06-07 12:25:27', '2012-06-07 14:07:57', '22485', 39690, 4, NULL, 'andros-1-lt-wall-sconce', NULL, NULL, 1),
(9026, 'vetraio, 2-lt vanity strip', NULL, 'Klasszikus, európai vasszerkezetű csillár, nehéz, kézzel készült üvegbúrákkal; így ötvözve a hagyományos megjelenést a modern minőséggel.', 10, '2012-06-07 12:25:28', '2012-06-07 14:07:57', '22800', 55890, 4, NULL, 'vetraio-2-lt-vanity-strip', NULL, NULL, 1),
