(9031, 'kimoni, armchair', NULL, 'Stílusos, egzotikus, magas háttámlával és hajlított hátsó lábakkal kidolgozott karosszék, plüss csíkokkal, fekete gallírozással és oldalsó díszítéssel, kétsoros szegecseléssel és ébenfa színű lábakkal. Keményfa szerkezet, kivehető ülőpárnával. Könnyen összeszerelhető.', 9, '2012-06-07 12:25:29', '2012-06-07 14:07:57', '23003', 298890, NULL, NULL, 'kimoni-armchair', NULL, NULL, 1),
(9032, 'derek, armchair', NULL, 'Dupla szegecssorral díszített, nyeregbarna műbőr kárpittal borított, kompakt profilú klubszék, örvény mintás, gesztenyebarna plüss ülőrésszel, kivehető üléspárnával és diószínű lábakkal.', 9, '2012-06-07 12:25:30', '2012-06-07 14:07:58', '23004', 258390, NULL, NULL, 'derek-armchair', NULL, NULL, 1),
(9033, 'wattley, storage ottoman', NULL, 'Egyeletlen, fekete-barna színű, mosható és légáteresztő műbőr kárpit, duplán varrott, rácshálós díszítéssel. Levehető teteje rámán varrott szegéllyel, felbecsülhetetlen tároló felületet kínál.  Viharvert, hikori fa árnyalatú, lábai szegecsekkel díszítettek.', 9, '2012-06-07 12:25:30', '2012-06-07 14:07:58', '23005', 153090, NULL, NULL, 'wattley-storage-ottoman', NULL, NULL, 1),
(9034, 'amani, armchair', NULL, 'Az Amani karosszék letisztult stílusa és természetes árnyalata tökéletes összhangot teremt bármilyen bútorral. A duplasoros szegecsfejes díszítés szépen egybeköti a világos plüss ülőrészt és a hüllőmintás oldalborítást. A karosszék gazdag dió kidolgozású lábakon áll. Hozzá illő puff a 23007.', 9, '2012-06-07 12:25:31', '2012-06-07 14:07:58', '23006', 234090, NULL, NULL, 'amani-armchair', NULL, NULL, 1),
(9035, 'amani, ottoman', NULL, 'Az Armani puff letisztult stílusa és természetes árnyalata tökéletesen összhangot teremt az Amani karosszékkel, de más bútorokkal együtt is jól mutat. A gazdag dió kidolgozású lábakat szegecsfejek díszítik. Hozzá illő karosszék a 23006.', 9, '2012-06-07 12:25:31', '2012-06-07 14:07:58', '23007', 92340, NULL, NULL, 'amani-ottoman', NULL, NULL, 1),
(9036, 'gentry, armchair', NULL, 'Rugalmas műbőr, velúr bársony anyagokkal kárpitozott, többféle barna árnyalatú karosszék, festett sötétbarna keményfa lábakkal. Ülésmagasság: 50,8 cm.', 9, '2012-06-07 12:25:31', '2012-06-07 14:07:58', '23015', 321570, NULL, NULL, 'gentry-armchair', NULL, NULL, 1),
(9037, 'gideon, storage bench', NULL, 'A természetes cserzett bőr kényelmes, elnyűtt érzése, egy bársonyos, puha szövetbe zárva. A keményfa vázas puff, pad szerű kivitelezése az extra nagy ülő és tároló felületek kialakítását szolgálja; levehető teteje baseball öltésekkel és gombokkal díszített.', 9, '2012-06-07 12:25:32', '2012-06-07 14:07:58', '23019', 234090, NULL, NULL, 'gideon-storage-bench', NULL, NULL, 1),
(9038, 'brunner small, storage ottoman', NULL, 'Masszív, nyereg barna műbőr borítású tároló doboz, dekoratív varrással és szegecses díszítéssel; a könnyű mozgathatóság érdekében görgőkkel szerelve. Levehető teteje gazdag diószínű keményfa peremmel díszített.', 9, '2012-06-07 12:25:32', '2012-06-07 14:07:58', '23024', 112590, NULL, NULL, 'brunner-small-storage-ottoman', NULL, NULL, 1),
(9039, 'lucky, pet bed', NULL, 'Az ember legjobb barátja is megérdemel egy stílusos kényelmes fekhelyet és íme itt van egy. Ez a dívány tartós, barna bőrutánzat kárpitozású, megfordítható, vörösesbarna tűzött párnával, mely követi a keményfa keret ívét.', 9, '2012-06-07 12:25:32', '2012-06-07 14:07:58', '23025', 153090, NULL, NULL, 'lucky-pet-bed', NULL, NULL, 1),
(9040, 'beau, pet bed', NULL, 'Az ember legjobb barátja királynak vagy királynőnek érzi majd magát ebben a stílusos kutya-ágyban, mely tisztítható és légáteresztő nyeregbarna műbőr kárpitozású, bronz szegecseléssel és hangsúlyos keményfa kerettel. Plüss, cserszínű, megfordítható, szivacs párnája jól illeszkedi a keretbe és tisztításkor könnyen eltávolítható', 9, '2012-06-07 12:25:33', '2012-06-07 14:07:58', '23026', 177390, NULL, NULL, 'beau-pet-bed', NULL, NULL, 1);
