(9041, 'zebring, bench', NULL, 'Mély konyakszínű, tömör fa keretes pad, gombokkal díszített, tűzött, tengerkék, homok és kakaóbarna csíkos plüss huzattal. Ülőmagassága: 53,3 centiméter.', 9, '2012-06-07 12:25:33', '2012-06-07 14:07:59', '23027', 183870, NULL, NULL, 'zebring-bench', NULL, NULL, 1),
(9042, 'natalee, bench', NULL, 'Díszes kiegészítő, ez a szafari mintás, vörösesbarna és karamellszínű szőtt plüss kárpitozású pad, festett, kopott diószínű, faragott fa lábakkal. Ülőmagassága 53,3 centiméter.', 9, '2012-06-07 12:25:34', '2012-06-07 14:07:59', '23029', 193590, NULL, NULL, 'natalee-bench', NULL, NULL, 1),
(9043, 'clay, armchair', NULL, 'Kapcsolódjon ki ebben a natúr cserzett bőr kinézetű, bársonyosan puha, szövetkárpitos fotelben! A kereten végigfutó, antikolt bronz szegecsekkel díszített karosszék, ágyékpárnával és viharvert hikori színű fa lábakkal. Ülőmagassága: 48,3 centiméter.', 9, '2012-06-07 12:25:34', '2012-06-07 14:07:59', '23030', 274590, NULL, NULL, 'clay-armchair', NULL, NULL, 1),
(9044, 'samhain, armless chair', NULL, 'Tartós, ősz barna műbőr kárpitos karosszék, gombokkal tűzött háttámlával, egyedi szegecsfejes díszítéssel és meleg diószínű, elől görgős, tömör fa lábakkal. Ülőmagasság: 47 cm.', 9, '2012-06-07 12:25:35', '2012-06-07 14:07:59', '23032', 173340, NULL, NULL, 'samhain-armless-chair', NULL, NULL, 1),
(9045, 'nemera, storage ottoman', NULL, 'Buja barna és fekete foltos puff, fekete rámán varrott díszítéssel, levehető fedéllel és szövet-borítású belső résszel.', 9, '2012-06-07 12:25:35', '2012-06-07 14:07:59', '23033', 191970, NULL, NULL, 'nemera-storage-ottoman', NULL, NULL, 1),
(9046, 'papyrus, armchair', NULL, 'Festett diószínű, keményfa vázas, homok, tóp és meleg bézsszínű kárpittal borított karosszék, egyedileg elhelyezett réz szegecses díszítéssel. Ülőmagasság: 48,3 cm.', 9, '2012-06-07 12:25:35', '2012-06-07 14:07:59', '23034', 258390, NULL, NULL, 'papyrus-armchair', NULL, NULL, 1),
(9047, 'consuelo, pushback armchair', NULL, 'Kopott pekán kidolgozású keményfa keret, bársonyosan puha, nyeregbarna kárpittal és rézszínű szegecsfejes díszítéssel. Állítható háttámlával és lábtartóval. Ülőmagassága 48,3 cm.', 9, '2012-06-07 12:25:36', '2012-06-07 14:07:59', '23035', 282690, NULL, NULL, 'consuelo-pushback-armchair', NULL, NULL, 1),
(9048, 'tajo, pet bed', NULL, 'Fekete és arany leopárdmintás, kényelemes plüss párna, fekete poliuretán kárpitos tömör fa keretbe ágyazva, eszpresszó színű lábakkal.', 9, '2012-06-07 12:25:36', '2012-06-07 14:07:59', '23038', 144990, NULL, NULL, 'tajo-pet-bed', NULL, NULL, 1),
(9049, 'rexana, armchair', NULL, 'Finom állatbőr mintás, sivatagi homok színű, plüss zsenília borítású karosszék. A tömör fa váz művészi sziluettjét, a kézzel kidolgozott nap mosta pekán színű tömör fa lábak teszik teljessé. Ülőmagasság: 53,3 cm.', 9, '2012-06-07 12:25:37', '2012-06-07 14:08:00', '23039', 240570, NULL, NULL, 'rexana-armchair', NULL, NULL, 1),
(9050, 'lanessa, ottoman', NULL, 'Szabott, fényes tóp színű, hüllőmintás zsenília kárpittal borított puff, antikolt bársony huzatos, párnás ülőrésszel, hivalkodó, kézzel készült réz szegecses, gombos és selymes kötél díszítéssel és festett dió színű tömör fa lábakkal.', 9, '2012-06-07 12:25:37', '2012-06-07 14:08:00', '23040', 120690, NULL, NULL, 'lanessa-ottoman', NULL, NULL, 1),
(9051, 'ysia, ottoman', NULL, 'Görgős puff, velencei vörös és krémszínű mintás huzattal és bojtos fonott kötél díszítéssel.', 9, '2012-06-07 12:25:37', '2012-06-07 14:08:00', '23041', 151470, NULL, NULL, 'ysia-ottoman', NULL, NULL, 1),
(9052, 'aarika, armchair', NULL, 'Légáteresztő, tisztítható, szegecses fekete műbőr kárpittal borított karosszék,  aranybarna és fekete állatbőr mintás háttámlával, hozzá illő zsenília ülés- és csíkos ágyékpárnával, közepes dió színű keményfa lábakkal.', 9, '2012-06-07 12:25:38', '2012-06-07 14:08:00', '23043', 282690, NULL, NULL, 'aarika-armchair', NULL, NULL, 1),
(9053, 'christie, armchair', NULL, 'Természetes, sötét kávé árnyalatú, fényűzően puha vászon borítású karosszék, rögzített hátpárnával, szegecselt díszítéssel és közepes dió színű keményfa lábakkal. Ülőmagassága 50,8 cm.', 9, '2012-06-07 12:25:38', '2012-06-07 14:08:00', '23044', 274590, NULL, NULL, 'christie-armchair', NULL, NULL, 1),
(9054, 'taliaferro, armchair', NULL, 'Kényelmes karosszék, sötét grafit színű, bársonyos puha vászon ülőrésszel és fényes nikkel szegecsfejekkel díszített sötét eszpresszó színű fa lábakkal. Ülőmagassága: 53,3 cm.', 9, '2012-06-07 12:25:38', '2012-06-07 14:08:00', '23045', 315090, NULL, NULL, 'taliaferro-armchair', NULL, NULL, 1),
(9055, 'divinity, chaise', NULL, 'Gombokkal tűzött, sötét csokoládé műbőr pihenőágy, állatbőr mintás zsenília díszítéssel és pekándió foltos keményfa lábakkal. Ülőmagasság: 50,8 cm.', 9, '2012-06-07 12:25:39', '2012-06-07 14:08:00', '23046', 404190, NULL, NULL, 'divinity-chaise', NULL, NULL, 1),
(9056, 'fontaine, armchair', NULL, 'György kori stílust idéző, baloldali kidolgozású karosszék, vászon burkolatú ülőrésszel, kézzel kovácsolt bronz szegecseléssel. Fehér mahagóni fa kerete, viharvert fekete tónusú, natúr fa lábakban végződik. Ülőmagassága:', 9, '2012-06-07 12:25:39', '2012-06-07 14:08:00', '23047', 274590, NULL, NULL, 'fontaine-armchair', NULL, NULL, 1),
(9057, 'channing, armchair', NULL, 'Dupla csapolással megerősített, kézzel koptatott, antik fekete kidolgozású, fehér mahagóni vázas karosszék, réz szegecses díszítésű, klasszikus, állatbőrmintás plüss kárpittal és kivehető üléspárnával. Ülőmagassága 53,3 cm.', 9, '2012-06-07 12:25:40', '2012-06-07 14:08:00', '23048', 266490, NULL, NULL, 'channing-armchair', NULL, NULL, 1),
(9058, 'trixie, slipper chair', NULL, 'Dupla csapolással megerősített, antik fekete és natúr fa foltos mahagóni váz, gombokkal tűzött, bársonyosan sima, krémszínű szövet kárpittal és duplasoros acélszegecses díszítéssel. Ülőmagassága 52,1 cm.', 9, '2012-06-07 12:25:40', '2012-06-07 14:08:01', '23049', 161190, NULL, NULL, 'trixie-slipper-chair', NULL, NULL, 1),
(9059, 'tola, slipper chair', NULL, 'Antikolt meszelt mázas, dupla csapolással megerősített, kézzel faragott fehér mahagóni keret, természetes vászon és poliészter keverékű kárpittal.', 9, '2012-06-07 12:25:40', '2012-06-07 14:08:01', '23050', 238140, NULL, NULL, 'tola-slipper-chair', NULL, NULL, 1),
(9060, 'zander, wing chair', NULL, 'Csapolással megerősített, fehér mahagóni tömör fa szerkezet, kézzel felvitt kopott fekete kidolgozással, mely kiemeli a természetes fa alapot. Világos cser színű szabott kárpitozás, bronz szegecses díszítéssel. Ülőmagassága: 50,8 centiméter.', 9, '2012-06-07 12:25:41', '2012-06-07 14:08:01', '23051', 323190, NULL, NULL, 'zander-wing-chair', NULL, NULL, 1),
(9061, 'karline, small bench', NULL, 'Antikolt mandula tónusú, kézzel faragott fehér mahagóni vázas kispad, folt ellenálló, pamut és vászon keverékű, szövet huzattal és bronz szegecses díszítéssel.', 9, '2012-06-07 12:25:42', '2012-06-07 14:08:01', '23052', 136890, NULL, NULL, 'karline-small-bench', NULL, NULL, 1),
(9062, 'chiziana, pet bed', NULL, 'Szabott, bicast bőr borítású, keményfa keretes kisállat fekhely, ölelnivaló, gesztenyebarna színű bordás plüss párnával és dió árnyalatú, esztergált tömör fa lábakkal.', 9, '2012-06-07 12:25:42', '2012-06-07 14:08:01', '23053', 201690, NULL, NULL, 'chiziana-pet-bed', NULL, NULL, 1),
(9063, 'gregorio, ottoman table', NULL, 'Kézzel faragott, tömör mahagóni vázas dohányzó asztal, érett cseresznye színű asztallappal és szegecselt, nyeregbarna, párnázott műbőr peremmel.', 9, '2012-06-07 12:25:43', '2012-06-07 14:08:01', '23054', 241380, NULL, NULL, 'gregorio-ottoman-table', NULL, NULL, 1),
(9064, 'crevan, armchair', NULL, 'Csokoládébarna műbőr kárpittal borított, újrahasznosított keményfa vázas karosszék, feltűnő eszpresszó és krém színű, rámán varrott szabású ülőrésszel és sötét dió színű lábak. Ülőmagasság: 55,9 cm.', 9, '2012-06-07 12:25:43', '2012-06-07 14:08:01', '23055', 323190, NULL, NULL, 'crevan-armchair', NULL, NULL, 1),
