(10368, 'hallmar', NULL, 'Fekete alapon, enyhén kopott ezüst fényezésű tömör fa keret, világosszürke mázzal és 3 centiméter szélesen metszett tükörrel.', 2, '2012-06-07 12:32:56', '2012-06-07 12:32:56', '11217 B', 70470, 2, NULL, 'hallmar', NULL, NULL, 1),
(10369, 'malvina, clock', NULL, 'Kétoldalas óra, kopott, enyhén antikolt ezüst fényezésű, kézzel kovácsolt fém vázzal és óratokkal, elefántcsont színű óralappal és kvarc óraszerkezettel.', 4, '2012-06-07 12:32:56', '2012-06-07 14:10:52', '06714', 51030, 5, NULL, 'malvina-clock', NULL, NULL, 1),
(10370, 'guenevere', NULL, 'Fakó mahagóni barna valódi dombornyomott réz panelből készült keret, világos zsályaszínű mázzal és egy 3 centiméter szélesen metszett tükörrel.', 2, '2012-06-07 12:32:56', '2012-06-07 12:32:56', '07027 B', 144990, 5, NULL, 'guenevere', NULL, NULL, 1),
(10371, 'shayna', NULL, 'Enyhén koptatott gesztenyebarna kidolgozású, valódi dombornyomott réz panelből készült keret, világos zsálya színű mázzal és egy 3 centiméter szélesen metszett tükörrel.', 2, '2012-06-07 12:32:57', '2012-06-07 12:32:57', '07025 B', 136890, 5, NULL, 'shayna', NULL, NULL, 1),
(10372, 'rowena, mirror', NULL, 'Díszes, erősen koptatott mahagóni fa tónusú, valódi dombornyomott réz panelből álló keret, világos cser mázzal és antikolt arany belső peremmel. Hozzá illő konzol asztal a 26066-os cikk.', 2, '2012-06-07 12:32:57', '2012-06-07 12:32:57', '07026 B', 80190, 5, NULL, 'rowena-mirror', NULL, NULL, 1),
(10373, 'rudy, clock', NULL, 'Enyhén avíttas, rusztikus fekete óra, szürke mázzal, antikolt arany díszítéssel és kvarc óraszerkezettel.', 4, '2012-06-07 12:32:57', '2012-06-07 14:10:53', '06709', 110970, 5, NULL, 'rudy-clock', NULL, NULL, 1),
(10374, 'maitland, clock', NULL, 'Kétoldalas óra, enyhén kopott, rozsdabarna kidolgozású, kézzel kovácsolt fém vázzal és óratokkal, fakó bézs óralappal és kvarc óraszerkezettel.', 4, '2012-06-07 12:32:58', '2012-06-07 14:10:53', '06710', 72090, 5, NULL, 'maitland-clock', NULL, NULL, 1),
(10375, 'jamil, clock', NULL, 'Kézzel kovácsolt fém óra, mély barna repedezett antikolt bronz fém részekkel, kvarc óraszerkezettel.', 4, '2012-06-07 12:32:58', '2012-06-07 14:10:53', '06704', 72090, 4, NULL, 'jamil-clock', NULL, NULL, 1),
(10376, 'ava, table', NULL, 'Szép, rozsdabarna kidolgozású, kézzel kovácsolt fém vázas asztal, fehér, barna foltos márvány asztallappal.', 9, '2012-06-07 12:32:58', '2012-06-07 14:10:53', '26064', 119070, NULL, NULL, 'ava-table', NULL, NULL, 1),
(10377, 'darian light', NULL, 'Kézzel csiszolt, gesztenyebarna kidolgozású tömör fa keret, zsálya színű mázzal, antikolt arany fényezésű külső és belső szegéllyel és metszett tükörrel.', 2, '2012-06-07 12:32:59', '2012-06-07 12:32:59', '07015 B', 63990, 5, NULL, 'darian-light', NULL, NULL, 1),
(10378, 'fabiano black', NULL, 'Kézzel csiszolt, fekete fa keret, szürke mázzal, antikolt arany fényezésű külső és belső peremmel és metszett tükörrel.', 2, '2012-06-07 12:32:59', '2012-06-07 12:32:59', '07023 B', 63990, 5, NULL, 'fabiano-black', NULL, NULL, 1),
(10379, 'red clay', NULL, 'Ez a békés, föld színű, kézzel festett műalkotás fa keresztfa szövetfeszítőkre erősített vászonra készült. A festmény kézműves jellege miatt, minden egyes darab finom különbségeket mutat.', 4, '2012-06-07 12:32:59', '2012-06-07 14:10:53', '32230', 72090, 5, NULL, 'red-clay', NULL, NULL, 1),
(10380, 'vamano', NULL, 'Avíttas, tengerzöld zománcozású kerámia lámpa, sötét bronz díszítőkkel és arany kiemelésekkel. A felül kerek, alul szögletes harang alakú lámpaernyő rozsdabézs vászonanyagból készült.', 10, '2012-06-07 12:32:59', '2012-06-07 14:10:53', '26853', 110970, 4, NULL, 'vamano', NULL, NULL, 1),
(10381, 'intersections i, ii, s/2', NULL, 'Kézi ecsetvonásokkal befejezett olajfestmény másolatok, barna, rozsda és szürke foltos, kézzel kovácsolt fém keretekben.', 4, '2012-06-07 12:33:00', '2012-06-07 14:10:53', '34021', 140940, 5, NULL, 'intersections-i-ii-s-2', NULL, NULL, 1),
(10382, 'melitta, charger', NULL, 'Fekete díszítésű, karamell tónusú dísz, világos ezüst mázzal és halvány sárga kiemelésekkel.', 4, '2012-06-07 12:33:00', '2012-06-07 14:10:53', '19624', 59130, 4, NULL, 'melitta-charger', NULL, NULL, 1),
(10383, 'teak root, large', NULL, 'Rusztikus, enyhén pácolt, natúr tíkfa gyökerekből készült tükörkeret. Természetes alapanyaga minden darabot egyedivé varázsol.', 2, '2012-06-07 12:33:00', '2012-06-07 12:33:00', '05024', 234090, 1, NULL, 'teak-root-large', NULL, NULL, 1),
(10384, 'eliseo', NULL, 'Festett világos diószínű, újrahasznosított fából készült keret, 3 centiméter szélesen metszett tükörrel.', 2, '2012-06-07 12:33:01', '2012-06-07 12:33:01', '09901', 136890, 3, NULL, 'eliseo', NULL, NULL, 1),
(10385, 'juniper, s/2', NULL, 'Dekoratív, zsályaszínű koptatású, antikolt arany fényezésű keretek, csiszolt fekete szegélyekkel és metszett tükrökkel.', 2, '2012-06-07 12:33:01', '2012-06-07 12:33:01', '11202 B', 80190, 2, NULL, 'juniper-s-2', NULL, NULL, 1),
(10386, 'cadence, small', NULL, 'Barna fatónusú keret, antikolt arany belső és külső szegélyekkel és metszett tükörrel.', 2, '2012-06-07 12:33:01', '2012-06-07 12:33:01', '11207 B', 104490, 2, NULL, 'cadence-small', NULL, NULL, 1),
(10387, 'dominique', NULL, 'Sötét vörös árnyalatú, fakó mahagóni kidolgozású fa keret, szürke kopásokkal és metszett tükörrel. A keret külső és belső szegélye valamint a Bourbon liliom motívum antikolt arany fényezésű.', 2, '2012-06-07 12:33:01', '2012-06-07 12:33:01', '11213 B', 128790, 2, NULL, 'dominique', NULL, NULL, 1),
(10388, 'indian musicians, s/3', NULL, 'Dombornyomott, kékes és vöröses árnyalatú, antikolt bronzszínű, kézzel kovácsolt fémből készült női alakok, matt fekete árnyékdoboz keretben.', 6, '2012-06-07 12:33:02', '2012-06-07 14:10:54', '04012', 120690, 1, NULL, 'indian-musicians-s-3', NULL, NULL, 1),
(10389, '1896 clock', NULL, 'Enyhén antikolt mahagóni kidolgozású falióra, réz díszítéssel. 1-C elem szükséges a működéséhez.', 4, '2012-06-07 12:33:02', '2012-06-07 14:10:54', '06002', 149850, 2, NULL, '1896-clock', NULL, NULL, 1),
(10390, 'leonardo chronograph black', NULL, 'Viharvert laminált óralap, öntött réz külső peremmel, réz központi alkatrészekkel és ingával. Az óra egy AA és egy D elemmel működik.', 4, '2012-06-07 12:33:02', '2012-06-07 14:10:54', '06003', 97200, 2, NULL, 'leonardo-chronograph-black', NULL, NULL, 1),
(10391, 'leonardo chronograph cream', NULL, 'Viharvert, laminált óralap, öntött réz külső peremmel és réz központi alkatrészekkel. Az óra egy darab AA és egy darab D elemmel működik.', 4, '2012-06-07 12:33:03', '2012-06-07 14:10:54', '06004', 97200, 2, NULL, 'leonardo-chronograph-cream', NULL, NULL, 1),
(10392, 'pocket watch brass thuret', NULL, 'Állítható, teleszkópos állványon lógó, réz zsebóra másolat. 1 darab AA elemmel működik. A tartóállvány magassága 20,3 és 31,8 centiméter között állítható.', 4, '2012-06-07 12:33:03', '2012-06-07 14:10:54', '06068', 29970, 2, NULL, 'pocket-watch-brass-thuret', NULL, NULL, 1),
(10393, 'pocket watch brass woodburn', NULL, 'Állítható, teleszkópos állványon lógó, réz zsebóra másolat. 1 darab AA elemmel működik. A tartóállvány magassága 20,3 és 31,8 centiméter között állítható.', 4, '2012-06-07 12:33:03', '2012-06-07 14:10:54', '06069', 29970, 2, NULL, 'pocket-watch-brass-woodburn', NULL, NULL, 1),
(10394, 'pocket watch nickel marchant black', NULL, 'Állítható, teleszkópos állványon lógó, nikkelezettt, sárgaréz zsebóra másolat. 1 darab AA elemmel működik. A tartóállvány magassága 20,3és 31,8 centiméter között állítható.', 4, '2012-06-07 12:33:03', '2012-06-07 14:10:55', '06071', 29970, 2, NULL, 'pocket-watch-nickel-marchant-black', NULL, NULL, 1),
(10395, 'akutan', NULL, 'Dombornyomott, antikolt alumínium fólia és kézzel kovácsolt fém rúddal összekötött, kézzel faragott fa érmék, újrahasznosított természetes fa deszkalapon. Vízszintesen és függőlegesen is falra akasztható.', 6, '2012-06-07 12:33:04', '2012-06-07 14:10:55', '04007', 161190, 1, NULL, 'akutan', NULL, NULL, 1),
(10396, 'metal ferns, s/2', NULL, 'Kézzel kovácsolt, antikolt fémből készült páfrányokat ábrázoló díszes falitáblák, újrahasznosított természetes fadeszkákon. Vízszintesen és függőlegesen is falra akasztható.', 6, '2012-06-07 12:33:04', '2012-06-07 14:10:55', '04005', 96390, 1, NULL, 'metal-ferns-s-2', NULL, NULL, 1),
(10397, 'sunset lake', NULL, 'Nyugodt festmény bézs és szürke vászon képszegéllyel, sötétbarna és fekete foltos bronz kidolgozású keretben. A képet üveg fedi.', 4, '2012-06-07 12:33:04', '2012-06-07 14:10:55', '33576', 55890, 5, NULL, 'sunset-lake', NULL, NULL, 1),
(10398, 'conrad', NULL, 'Ezüstözött, kortárs lámpa, kézzel festett antikolással és kézzel varrott, téglalap alakú harang szövet lámpaernyővel.', 10, '2012-06-07 12:33:04', '2012-06-07 14:10:55', '27800', 47790, 4, NULL, 'conrad', NULL, NULL, 1);
