INSERT INTO `product_translations` (`id`, `product_id`, `locale`, `short_description`, `long_description`, `advice`, `created_at`, `updated_at`) VALUES
(16742, 7878, 'hu', NULL, 'Élénk képek, homokszínű külső és bézsszínű belső vászon képszegélyekkel, fekete fényes keretekben.', NULL, '2012-06-07 12:19:28', '2012-06-07 12:19:28'),
(16743, 7879, 'hu', NULL, 'Bézs és barnás szürke színű szövött képszegéllyel körülvett festmények, sötét eszpresszó kidolgozású keretekben, szürke mázas belső peremekkel és szegélylécekkel. A képeket üveg fedi.', NULL, '2012-06-07 12:19:29', '2012-06-07 12:19:29'),
(16744, 7880, 'hu', NULL, 'Ovális tükör antik ezüst keretbe foglalva.', NULL, '2012-06-07 12:19:30', '2012-06-07 12:19:30'),
(16745, 7881, 'hu', NULL, 'Gömbölyű tükör, avíttas fa árnyalatú keretben, csiszolt élekkel.', NULL, '2012-06-07 12:19:30', '2012-06-07 12:19:30'),
(16746, 7882, 'hu', NULL, 'Repedezett antik fekete keret, antik aranyszínű belső szegéllyel.', NULL, '2012-06-07 12:19:31', '2012-06-07 12:19:31'),
(16747, 7883, 'hu', NULL, 'Antikfoltos, arany fényezésű keret.', NULL, '2012-06-07 12:19:31', '2012-06-07 12:19:31'),
(16748, 7884, 'hu', NULL, 'Világos fa árnyalatú, tömör fa keret, metszett tükörrel. Vízszintesen és függőlegesen is falra akasztható.', NULL, '2012-06-07 12:19:32', '2012-06-07 12:19:32'),
(16749, 7885, 'hu', NULL, 'Erősen avíttas, fekete színű, tömör fa keret, metszett tükörrel. Vízszintesen és függőlegesen is falra akasztható.', NULL, '2012-06-07 12:19:32', '2012-06-07 12:19:32'),
(16750, 7886, 'hu', NULL, 'Repedezett, koptatott fekete színű, ovális keret, rozsdaszínű mázzal és erősen antikolt aranyszínű belső szegéllyel, mely körülöleli a metszett tükröt. Dekoratív ezüstszínű motívumok is díszítik a tükröt.', NULL, '2012-06-07 12:19:33', '2012-06-07 12:19:33'),
(16751, 7887, 'hu', NULL, 'Modern tükröt, szálcsiszolt, nikkel fényezésű, fém keretben. A tükör 3 centiméter szélesen metszett.', NULL, '2012-06-07 12:19:33', '2012-06-07 12:19:33'),
(16752, 7888, 'hu', NULL, 'Kézzel kovácsolt fémből készült, gyöngyös, ovális keret, enyhén avíttas olaj dörzsölte bronz fényezéssel, metszett tükörrel.', NULL, '2012-06-07 12:19:34', '2012-06-07 12:19:34'),
(16753, 7889, 'hu', NULL, 'Szálcsiszolt nikkelezésű, kézzel kovácsolt fém keret, ovális metszett tükörrel. A tükör vízszintesen és függőlegesen is falra akasztható.', NULL, '2012-06-07 12:19:34', '2012-06-07 12:19:34'),
