(17898, 9034, 'hu', NULL, 'Az Amani karosszék letisztult stílusa és természetes árnyalata tökéletes összhangot teremt bármilyen bútorral. A duplasoros szegecsfejes díszítés szépen egybeköti a világos plüss ülőrészt és a hüllőmintás oldalborítást. A karosszék gazdag dió kidolgozású lábakon áll. Hozzá illő puff a 23007.', NULL, '2012-06-07 12:25:31', '2012-06-07 12:25:31'),
