(17900, 9036, 'hu', NULL, 'Rugalmas műbőr, velúr bársony anyagokkal kárpitozott, többféle barna árnyalatú karosszék, festett sötétbarna keményfa lábakkal. Ülésmagasság: 50,8 cm.', NULL, '2012-06-07 12:25:31', '2012-06-07 12:25:31'),
(17901, 9037, 'hu', NULL, 'A természetes cserzett bőr kényelmes, elnyűtt érzése, egy bársonyos, puha szövetbe zárva. A keményfa vázas puff, pad szerű kivitelezése az extra nagy ülő és tároló felületek kialakítását szolgálja; levehető teteje baseball öltésekkel és gombokkal díszített.', NULL, '2012-06-07 12:25:32', '2012-06-07 12:25:32'),
(17902, 9038, 'hu', NULL, 'Masszív, nyereg barna műbőr borítású tároló doboz, dekoratív varrással és szegecses díszítéssel; a könnyű mozgathatóság érdekében görgőkkel szerelve. Levehető teteje gazdag diószínű keményfa peremmel díszített.', NULL, '2012-06-07 12:25:32', '2012-06-07 12:25:32'),
