(17966, 9102, 'hu', NULL, 'Cseresznye kidolgozású, hat polcos szekrény, orsókkal díszített, esztergált tömör fa vázzal.', NULL, '2012-06-07 12:25:56', '2012-06-07 12:25:56'),
(17967, 9103, 'hu', NULL, 'Impozáns, enyhén antikolt dió kidolgozású, fehér mahagóni, és okumé fa furnérból készült komód.', NULL, '2012-06-07 12:25:57', '2012-06-07 12:25:57'),
(17968, 9104, 'hu', NULL, 'Kézzel faragott nyárfa váz, enyhén kopott diószínű, fehér mahagóni furnér asztallappal.', NULL, '2012-06-07 12:25:57', '2012-06-07 12:25:57'),
(17969, 9105, 'hu', NULL, 'Szilárd, faragott tömör fa talp, az arany és a barna árnyalataival kidolgozott, fehér mahagóni, cseresznye és cédrus furnér berakásokkal díszített asztallappal.', NULL, '2012-06-07 12:25:57', '2012-06-07 12:25:57'),
(17970, 9106, 'hu', NULL, 'Aranybarna fehér mahagónifából és gazdag mahagóni furnérból készült, íves kialakítású fiókos szekrény, faragott díszléccel és antikolt bronz karika fogantyúkkal. Hozzá illő tükör: 01908-as cikk.', NULL, '2012-06-07 12:25:58', '2012-06-07 12:25:58'),
(17971, 9107, 'hu', NULL, 'Sötét eszpresszó árnyalatú, tömör nyárfavázas asztalok, hársfa furnér asztallapokkal és kecses faragásokkal. Méretek: Kicsi: 25,4x55,9x25,4 cm; Nagy: 33x63,5x33 cm.', NULL, '2012-06-07 12:25:58', '2012-06-07 12:25:58'),
(17972, 9108, 'hu', NULL, 'Sötét eszpresszó kidolgozású zebrafa, foltos gesztenyeszínű vas vázzal és fa talppal.', NULL, '2012-06-07 12:25:58', '2012-06-07 12:25:58'),
(17973, 9109, 'hu', NULL, 'A kecses, sima vonalak és az enyhén felfelé ívelő asztallap teszik jellegzetessé ezt az asztalt. A tömör nyárfa és cseresznyefa furnérból készült váz enyhén koptatott fekete kidolgozással.', NULL, '2012-06-07 12:25:59', '2012-06-07 12:25:59'),
(17974, 9110, 'hu', NULL, 'Csiszolt zebrafa polc és asztallap, antikolt réz görgős, bordás, bronz kidolgozású, fém lábakkal.', NULL, '2012-06-07 12:25:59', '2012-06-07 12:25:59'),
(17975, 9111, 'hu', NULL, 'Pompás, mély bordó kidolgozású, tömör nyárfából készült váz, furnérozott polcokkal.', NULL, '2012-06-07 12:25:59', '2012-06-07 12:25:59'),
(17976, 9112, 'hu', NULL, 'Sötét, fényes padlizsán kidolgozású tömör nyárfa asztal antikolt tükör lapokkal.', NULL, '2012-06-07 12:25:59', '2012-06-07 12:25:59'),
(17977, 9113, 'hu', NULL, 'Erősen kopott fekete, nyolc fiókos komód, rusztikus dió beütéssel és világos cser mázzal.', NULL, '2012-06-07 12:26:00', '2012-06-07 12:26:00'),
(17978, 9114, 'hu', NULL, 'Világos cserszínű mázas, rusztikus dió alapon erősen koptatott fekete kidolgozású két fiókos asztal, esztergált fa lábakkal. Hozzá illő tükör a 13715-ös cikk.', NULL, '2012-06-07 12:26:00', '2012-06-07 12:26:00'),
(17979, 9115, 'hu', NULL, 'Klasszikus cseresznye kidolgozású, nyír és zebrafa könyvespolc, egymásra épített, kacskaringós fém vázas, fa polcokkal.', NULL, '2012-06-07 12:26:00', '2012-06-07 12:26:00'),
(17980, 9116, 'hu', NULL, 'Barna dió vázas szekrény, nyolc antikolt ón fogantyúkkal díszített, faragott, füstös vörös öntvény kidolgozású fiókkal.', NULL, '2012-06-07 12:26:01', '2012-06-07 12:26:01'),
(17981, 9117, 'hu', NULL, 'Ragyogó világos cseresznye kidolgozású, fehér mahagóni, zebrafa és cseresznyefa furnérokból készült asztal, antikolt réz fiók fogantyúval.', NULL, '2012-06-07 12:26:01', '2012-06-07 12:26:01'),
(17982, 9118, 'hu', NULL, 'Szürke mázas, ecsetvonásokkal díszített, tömör nyárfa vázas asztal, rézbronz kidolgozású szövött fém asztallappal.', NULL, '2012-06-07 12:26:01', '2012-06-07 12:26:01'),
(17983, 9119, 'hu', NULL, 'Kopott kidolgozású, fehér mahagóni furnérból készült, kényelmes kialakítású asztal, három  fiókkal, ónozott fogantyúkkal.', NULL, '2012-06-07 12:26:01', '2012-06-07 12:26:02'),
(17984, 9120, 'hu', NULL, 'Faragott, vékony, tömör nyárfa lábak és hozzá illő, meleg, antik pekán kidolgozású, cseresznyefa furnér asztallap.', NULL, '2012-06-07 12:26:02', '2012-06-07 12:26:02'),
(17985, 9121, 'hu', NULL, 'Lépcsőzetes kialakítású, antikolt pekándió pácolású, különleges, cseresznye furnér asztalkák. A legkisebb asztalka két polca és a kereszt rudak tömör hársfából készültek. Méretek: Kicsi: 40,6x66x30,5 cm; Közepes: 53,3x71,1x33 cm; Nagy: 66x76,2x35,6 cm.', NULL, '2012-06-07 12:26:02', '2012-06-07 12:26:02'),
(17986, 9122, 'hu', NULL, 'Tömör hársfa vázas, antikolt pekán kidolgozású, fehér mahagóni, cseresznye és cédrus furnérból készült konzol szekrény. Mindkét oldalon egy állítható magasságú polc található a szekrényben, kettő pedig a szekrényen kívül.', NULL, '2012-06-07 12:26:03', '2012-06-07 12:26:03'),
(17987, 9123, 'hu', NULL, 'Antik hikori fa kidolgozású, keményfa vázas bárszék, kaktusz színű kárpittal borított ülőrésszel és háttámlával, fém védőlemezzel a kereszt rudakon. Ülőmagasság: 76,2 cm.', NULL, '2012-06-07 12:26:03', '2012-06-07 12:26:03'),
(17988, 9124, 'hu', NULL, 'Antik pekándió pácolású cseresznye és nyers cédrus furnérlemezből készült komód. A felső lap forgó részének felemelésével, kisméretű író- vagy tálalólap hozható létre. Bronz, rúd fogantyúkkal díszített hat fiókja, akkor is elérhető, amikor a tálalólap éppen használatban van.', NULL, '2012-06-07 12:26:04', '2012-06-07 12:26:04'),
(17989, 9125, 'hu', NULL, 'Cseresznye, fehér mahagóni, zebrafa és cédrus berakásokkal díszített asztallap, fényes pekán kidolgozású, faragott tömör fa lábbal.', NULL, '2012-06-07 12:26:04', '2012-06-07 12:26:04'),
(17990, 9126, 'hu', NULL, 'Áfonya és venyige zöld színű, finom kézi festéssel díszített antikolt elefántcsont kidolgozású asztalka.', NULL, '2012-06-07 12:26:04', '2012-06-07 12:26:04'),
(17991, 9127, 'hu', NULL, 'Kopott, kézzel festett pala fekete asztal, nyírfurnér asztallappal és a tömör nyárfa lábakkal. A játéktábla megfordításával ostábla vagy dámajáték táblát kapunk. A bábúk kézzel festett vörös és fekete színűek.', NULL, '2012-06-07 12:26:05', '2012-06-07 12:26:05'),
(17992, 9128, 'hu', NULL, 'Avítt, búzaszínű és rozsdabarna tónusú, természetes fa kidolgozású asztalka, francia  fiókkal és a tetejét, oldalait és hátulját díszítő antikolt tükrökkel.', NULL, '2012-06-07 12:26:05', '2012-06-07 12:26:05'),
(17993, 9129, 'hu', NULL, 'Vörös árnyalatú, kopott pala fekete kidolgozású, faragott díszítésű, görgős magazinasztal, a könyveknek kialakított négy rekesszel és francia  fiókkal.', NULL, '2012-06-07 12:26:05', '2012-06-07 12:26:05'),
(17994, 9130, 'hu', NULL, 'Kopott dió kidolgozású cseresznyefa furnér lámpaasztal, festett grafitszürke keményfa lábakkal és díszítéssel. A francia  fiókot dekoratív sötét bronz fogantyú díszíti.', NULL, '2012-06-07 12:26:06', '2012-06-07 12:26:06'),
(17995, 9131, 'hu', NULL, 'Gazdag, öreg tölgy kidolgozású faragott lábak és eresztékes fiókok, patinás akantusz levél fogantyúkkal.', NULL, '2012-06-07 12:26:06', '2012-06-07 12:26:06'),
(17996, 9132, 'hu', NULL, 'Mahagóni és fekete dió furnérból készült, pala fekete színű asztal, részletesen kidolgozott, kézzel festett elefántcsontszínű díszítéssel.', NULL, '2012-06-07 12:26:06', '2012-06-07 12:26:06'),
(17997, 9133, 'hu', NULL, 'Hamuszürke foltos, nyomokban érett fekete festésű, erősen kopott tölgy és mahagóni furnér konzolasztal, kézzel faragott talppal.', NULL, '2012-06-07 12:26:07', '2012-06-07 12:26:07'),
(17998, 9134, 'hu', NULL, 'Sötét mahagóni furnérból készült asztal, kopott élekkel és kézzel festett és koptatott szürke díszítéssel és oldalsó falakkal.', NULL, '2012-06-07 12:26:07', '2012-06-07 12:26:07'),
(17999, 9135, 'hu', NULL, 'Nap mosta pekán kidolgozású, esztergált tömör fa szekrény, esztergált fa fogantyúkkal díszített francia  fiókokkal. A fiókok és a váz oldalai búza tónusú, bambusz furnérból készültek.', NULL, '2012-06-07 12:26:07', '2012-06-07 12:26:07'),
(18000, 9136, 'hu', NULL, 'Mahagónifa alapon kopott meleg vörös kidolgozású játékasztal, festett fekete dámajáték és sakk táblákkal. Két cink bevonatos italtartóval és két fiókkal, melyben tárolhatja a vörös és fekete dámajáték bábúkat.', NULL, '2012-06-07 12:26:08', '2012-06-07 12:26:08'),
(18001, 9137, 'hu', NULL, 'Kézzel festett, barackvirág színű művészi mintákkal díszített, elefántcsontszínű konzolasztal, esztergált tömör nyárfa lábakkal és metszett tükör hátlappal.', NULL, '2012-06-07 12:26:08', '2012-06-07 12:26:08');
