(18004, 9140, 'hu', NULL, 'Foltos, fehér mahagóni furnér konzolasztal, kézzel faragott keményfa díszítéssel és két fiókkal. Hozzá illő tükör a 1902-es cikk.', NULL, '2012-06-07 12:26:09', '2012-06-07 12:26:09'),
(18005, 9141, 'hu', NULL, 'Kopott, festett fekete szekrény, ruhamintákkal és domborművekkel díszített rozsdabarna, íves ajtókkal és egy fix polccal.', NULL, '2012-06-07 12:26:09', '2012-06-07 12:26:09'),
