(18007, 9143, 'hu', NULL, 'Festett mahagóni kidolgozású tömör nyárfa vázas szekrény, cseresznyefa furnérból készült, fiókokkal és kávébronz fiók fogantyúkkal.', NULL, '2012-06-07 12:26:10', '2012-06-07 12:26:10'),
(18008, 9144, 'hu', NULL, 'Sötét csokoládébarna kidolgozású tömör nyárfa asztal, süllyesztett antikolt tükör asztallappal.', NULL, '2012-06-07 12:26:10', '2012-06-07 12:26:10'),
(18009, 9145, 'hu', NULL, 'Mutatós, nyitott, csigavonal mintás paraván, sötétszürke tónusú, csiszolt alumínium kidolgozással.', NULL, '2012-06-07 12:26:11', '2012-06-07 12:26:11'),
(18010, 9146, 'hu', NULL, 'Konzolasztal, lekerekített, csiszolt üveglapokkal díszített, hajlított panellel, asztallappal és lábakkal. Hozzá illő tükör: 08081-es elem.', NULL, '2012-06-07 12:26:11', '2012-06-07 12:26:11'),
(18011, 9147, 'hu', NULL, 'Antikolt tükör oldalak, króm fogantyúkkal, fekete belső burkolattal és egy állítható magasságú polccal. Hozzá illő tükör: 08076-os cikk.', NULL, '2012-06-07 12:26:11', '2012-06-07 12:26:11'),
(18012, 9148, 'hu', NULL, 'Csiszolt, venyigegrafit színű, kacskaringós, kézzel kovácsolt fém díszítésű, félhold alakú konzolasztal.', NULL, '2012-06-07 12:26:12', '2012-06-07 12:26:12'),
(18013, 9149, 'hu', NULL, 'Fehér mahagóni furnérból és tömör nyárfából készült, impozáns, dupla íves szekrény, antik réz fogantyúkkal díszített, angol  fiókokkal.', NULL, '2012-06-07 12:26:12', '2012-06-07 12:26:12'),
(18014, 9150, 'hu', NULL, 'Tömör nyárfa vázas, klasszikus, napszítta pekán kidolgozású, cédrus szekrény, süllyesztett réz fogantyús, angol  fiókokkal és egy kihúzható polccal.', NULL, '2012-06-07 12:26:12', '2012-06-07 12:26:12'),
(18015, 9151, 'hu', NULL, 'Cseresznye, fehér mahagóni és zebrafa furnér berakásokkal díszített asztallap, esztergált tömör fehér mahagóni fa lábakkal.', NULL, '2012-06-07 12:26:12', '2012-06-07 12:26:12'),
(18016, 9152, 'hu', NULL, 'Délnyugati nyír furnérlapból készült komód, sötét eszpresszó foltos, keményfa lábakkal; nyolc, beékelt, cinóbervörös bronz fogantyúkkal díszített,  fiókkal.', NULL, '2012-06-07 12:26:13', '2012-06-07 12:26:13'),
(18017, 9153, 'hu', NULL, 'Gazdag diófurnér asztallap, kopott, fényes grafit kidolgozású, faragott tömör fa talppal.', NULL, '2012-06-07 12:26:13', '2012-06-07 12:26:13'),
(18018, 9154, 'hu', NULL, 'Látványos, cédrus, dió-, cseresznye-, és fehér babérfa berakásokkal díszített asztallap, repedezett antik tóp kidolgozású, esztergált fehér mahagóni fa talppal.', NULL, '2012-06-07 12:26:14', '2012-06-07 12:26:14'),
(18019, 9155, 'hu', NULL, 'Fényes, poros antikolt fekete és sötét dió színű, tömör nyárfa vázas szék, légáteresztő, tisztítható, nyeregbarna műbőr üléshuzattal. Ülőmagasság: 50,8 cm.', NULL, '2012-06-07 12:26:14', '2012-06-07 12:26:14'),
(18020, 9156, 'hu', NULL, 'Poros, antik fekete és sötét dió kidolgozású, nyírfa furnér asztallap, faragott tömör nyárfa talppal.', NULL, '2012-06-07 12:26:15', '2012-06-07 12:26:15'),
(18021, 9157, 'hu', NULL, 'A sötét diópácos juhar furnérig koptatott, antikolt meleg vörös kidolgozású asztallap, tömör nyárfa talppal.', NULL, '2012-06-07 12:26:15', '2012-06-07 12:26:15'),
(18022, 9158, 'hu', NULL, 'Klasszikus, faragott asztal, oxidálódott, szürke tónusú, kopott, rozsdabarna kidolgozású tömör nyárfa talppal és fehér mahagóni furnér asztallappal.', NULL, '2012-06-07 12:26:15', '2012-06-07 12:26:15'),
(18023, 9159, 'hu', NULL, 'Antikolt, poros pala árnyalatú, klasszikus faragású, tömör nyárfa asztalka, bordázott lábakkal és  fiókkal.', NULL, '2012-06-07 12:26:15', '2012-06-07 12:26:15'),
(18024, 9160, 'hu', NULL, 'Antikolt, poros fekete, szilárd, faragott nyárfa vázas asztal, avíttas koptatott foltokkal; lehajtható, rusztikus, meleg gesztenye árnyalatú, tölgyfa furnér asztallappal. A lehajtható lapok szélessége mindkét oldalon 20,3 centiméter.', NULL, '2012-06-07 12:26:16', '2012-06-07 12:26:16'),
(18025, 9161, 'hu', NULL, 'Szürke bőr hatású tutajfa kidolgozású asztal, süllyesztett antikolt tükör berakásokkal díszített asztallappal és talpazattal.', NULL, '2012-06-07 12:26:16', '2012-06-07 12:26:16'),
(18026, 9162, 'hu', NULL, 'Mély, antik hikori fa árnyalatú, nyárfa alap,  fiókkal; koptatott, kézzel festett, sötét hamu színű fém vázzal és átlátszó, edzett üveg polcokkal.', NULL, '2012-06-07 12:26:17', '2012-06-07 12:26:17'),
(18027, 9163, 'hu', NULL, 'Antikolt fehér színű, keményfa asztal tetején kézzel festett klasszikus sötétkék és piros mintákkal.', NULL, '2012-06-07 12:26:17', '2012-06-07 12:26:17'),
(18028, 9164, 'hu', NULL, 'Masszív, kézzel faragott, klasszikus mintázatú, festet bézs tömör fa szekrény, natúr, csaphornyos, nyírfa hátlappal, két fiókkal, három állítható és egy fix polccal.', NULL, '2012-06-07 12:26:17', '2012-06-07 12:26:17'),
(18029, 9165, 'hu', NULL, 'Művészien faragott tömör nyárfa asztal, festett eszpresszó színű, sötét dió furnér asztallappal és patinás bronz fogantyúval díszített  fiókkal.', NULL, '2012-06-07 12:26:18', '2012-06-07 12:26:18'),
(18030, 9166, 'hu', NULL, 'fehér homok színű, tömör fenyő palánkokból készült asztal, három, tipli és blokk díszítésű,  fiókkal.', NULL, '2012-06-07 12:26:18', '2012-06-07 12:26:18'),
(18031, 9167, 'hu', NULL, 'sötét bronz színű fém vázas asztal, kézzel kidolgozott fenyő deszka asztallappal, természetes szürke mosással.', NULL, '2012-06-07 12:26:18', '2012-06-07 12:26:18'),
(18032, 9168, 'hu', NULL, 'Domború faragással díszített, szürke banánfakéreg borítású fa asztal, pormázas, kézzel kovácsolt, kacskaringós vas lábakkal.', NULL, '2012-06-07 12:26:19', '2012-06-07 12:26:19'),
(18033, 9169, 'hu', NULL, 'Faragott, szilárd fenyő virágtartók; rusztikus, viaszolt, mészkő kidolgozással. Méretek: Kicsi: 27,9x76,2x27,9 cm; Nagy: 30,5x86,4x30,5 cm.', NULL, '2012-06-07 12:26:19', '2012-06-07 12:26:19'),
(18034, 9170, 'hu', NULL, 'Fényes, csiszolt pekán kidolgozású, finom mintázatú,  cédrus furnér váz, sötét dió színű tömör nyárfa lábakkal és ón fogantyús, francia  fiókokkal.', NULL, '2012-06-07 12:26:19', '2012-06-07 12:26:19'),
(18035, 9171, 'hu', NULL, 'Enyhén antikolt, festett rózsafa kidolgozású szekrény, kopott élekkel, stílusos madár és ágmintás faragott ajtó panelekkel és belső polccal.', NULL, '2012-06-07 12:26:20', '2012-06-07 12:26:20'),
(18036, 9172, 'hu', NULL, 'Mandula foltos, avítt nyír-furnér szekrény, lepattogzott festésű, antikolt elefántcsont kidolgozással; régies, vas fogantyúkkal díszített, francia  fiókokkal.', NULL, '2012-06-07 12:26:20', '2012-06-07 12:26:20'),
(18037, 9173, 'hu', NULL, 'Festett mandulaszínű asztal, repedezett elefántcsont kidolgozással.', NULL, '2012-06-07 12:26:20', '2012-06-07 12:26:20'),
(18038, 9174, 'hu', NULL, 'Aranybarna koptatású, tavaszi moha zöld kidolgozású könyöklő.', NULL, '2012-06-07 12:26:20', '2012-06-07 12:26:20'),
