(18373, 9509, 'hu', NULL, 'Két árnyalatú porcelán lámpa, melynek az első és hátsó oldala mély bordó, míg a teteje és az oldalsó lapjai rusztikus, égetett narancs zománcozásúak; csokoládébronz díszítőkkel. A téglalap alakú harang lámpaernyő rusztikus vászonanyagból készült.', NULL, '2012-06-07 12:28:07', '2012-06-07 12:28:07'),
(18374, 9510, 'hu', NULL, 'Fekete, barna és elefántcsont mintázatú márványból készült lámpatest, bronzos fém díszítéssel és éjszakai fénnyel. A téglalap alakú merev lámpaernyő bronzszínű műbőrből készült.', NULL, '2012-06-07 12:28:08', '2012-06-07 12:28:08'),
(18375, 9511, 'hu', NULL, 'Cserszínű alapon kopott fekete, repedezett  kidolgozású vászon lámpatest, fényes nikkel díszítéssel. A téglalap alakú harang lámpaernyő selymes pezsgőszínű anyagból készült.', NULL, '2012-06-07 12:28:08', '2012-06-07 12:28:08'),
(18376, 9512, 'hu', NULL, 'Repedezett, paradicsom piros porcelán lámpatest, sötét bronz részekkel és selymes barnás szürke színű anyagból készült, téglalap alakú harang lámpaernyővel.', NULL, '2012-06-07 12:28:08', '2012-06-07 12:28:08'),
(18377, 9513, 'hu', NULL, 'Sötét márványból készült asztali lámpa, olajfényes bronz  fém díszítéssel és barnás szürke színű vászonból készült, téglalap alakú harang lámpaernyővel.', NULL, '2012-06-07 12:28:08', '2012-06-07 12:28:08'),
(18378, 9514, 'hu', NULL, 'Mahagóni bronz kidolgozású asztali lámpa, barnás szürke színű vászonból készült kerek harang alakú lámpaernyővel.', NULL, '2012-06-07 12:28:09', '2012-06-07 12:28:09'),
(18379, 9515, 'hu', NULL, 'Aranybronz kidolgozású fém lámpatest, antikolt fa tónusú részekkel és barnás szürke színű vászonanyagból készült hatszögű lámpaernyővel.', NULL, '2012-06-07 12:28:09', '2012-06-07 12:28:09'),
(18380, 9516, 'hu', NULL, 'Olajfényű fém lámpatest, antikolt tojáshéj díszítéssel. A négyzetes harang alakú lámpaernyő selymes csokoládészínű anyagból készült.', NULL, '2012-06-07 12:28:09', '2012-06-07 12:28:09'),
(18381, 9517, 'hu', NULL, 'Antikolt ezüst bevonatú, fém lámpa, fekete tónusozással és csokoládé árnyalatú márvány díszítéssel. A harang alakú lámpaernyő selymes csokoládészínű szövetből készült.', NULL, '2012-06-07 12:28:10', '2012-06-07 12:28:10'),
(18382, 9518, 'hu', NULL, 'Szájjal fúvott üveg lámpatest, olajfényű bronz kidolgozású, fém részekkel és fekete szálsodrású, csokoládébronz színű szövetből készült négyzetes harang alakú lámpaernyővel.', NULL, '2012-06-07 12:28:10', '2012-06-07 12:28:10'),
(18383, 9519, 'hu', NULL, 'Bordázott üveg kidolgozású lámpatest, sötét bronz fém díszítőkkel. A kerek, harang alakú lámpaernyő természetes szálsodrású, elefántcsontszínű szövetből készült.', NULL, '2012-06-07 12:28:10', '2012-06-07 12:28:10'),
(18384, 9520, 'hu', NULL, 'Fényes nikkelezettt fém lámpatest, metszett tükör díszítőkkel. A téglalap alakú box lámpaernyő ezüstszürke színű, merevkötésű fekete szálsodrású vászonból készült.', NULL, '2012-06-07 12:28:10', '2012-06-07 12:28:11'),
(18385, 9521, 'hu', NULL, 'Enyhén antikolt, dombornyomott bádog lámpatest, aranybronz fém díszítéssel. A négyzet alakú harang lámpaernyő sötét szálsodrású, selymes csokoládébronz anyagból készült.', NULL, '2012-06-07 12:28:11', '2012-06-07 12:28:11'),
(18386, 9522, 'hu', NULL, 'Valódi, égetett gyöngyházból készült lámpatest, ezüstözött díszítőkkel. A négyzetes harang alakú lámpaernyő selymes pezsgő árnyalatú szövetből készült.', NULL, '2012-06-07 12:28:11', '2012-06-07 12:28:11'),
(18387, 9523, 'hu', NULL, 'Fekete krómozott fém lámpatest, fekete vászon szövetből készült téglalap alakú box lámpaernyővel.', NULL, '2012-06-07 12:28:11', '2012-06-07 12:28:11'),
