(18944, 10080, 'hu', NULL, 'Színes virág festmények, téglavörös belső és törtfehér külső képszegéllyel, nehéz szürke mázas, barna foltos, aranyozott keretekben.', NULL, '2012-06-07 12:31:25', '2012-06-07 12:31:25'),
(18945, 10081, 'hu', NULL, 'Olíva zöld belső és homokszínű külső képszegéllyel körülvett képek, fekete fényes keretekben, hozzá illő belső szegélylécekkel.', NULL, '2012-06-07 12:31:25', '2012-06-07 12:31:25'),
(18946, 10082, 'hu', NULL, 'Ez a kézzel festett, békés műalkotás feszített vászonra készült. Bronz alapon barna és fekete koptatású keret, fakó fekete belső szegéllyel.', NULL, '2012-06-07 12:31:26', '2012-06-07 12:31:26'),
(18947, 10083, 'hu', NULL, 'Kézzel festett olajkép, törtfehér vászon béléssel, barna és fekete foltos közepes fa tónusú keretben, fekete és barna foltos, arany-rézbronz külső és belső élekkel.', NULL, '2012-06-07 12:31:26', '2012-06-07 12:31:26'),
