(18949, 10085, 'hu', NULL, 'Kézzel festett olajképek, törtfehér vászon bélésekkel, fényes fekete fa keretekben. A keret belső szegélye barna foltos, ezüst fényezésű. A festmények kézműves jellege miatt, minden egyes darab finom különbségeket mutat.', NULL, '2012-06-07 12:31:27', '2012-06-07 12:31:27'),
(18950, 10086, 'hu', NULL, 'Ez a kézzel festett olajkép, fekete kemény táblára készült és fényes fekete fa keret szegélyezi. A keret belső szegélye barna foltos, fémes arany kidolgozású. A festmény kézműves jellege miatt, minden egyes darab finom különbségeket mutat.', NULL, '2012-06-07 12:31:27', '2012-06-07 12:31:27'),
(18951, 10087, 'hu', NULL, 'Ez a kézzel festett olajkép, fekete kemény táblára készült és enyhén barna foltos, ezüstözött fa keret szegélyezi. A festmény kézműves jellege miatt, minden egyes darab finom különbségeket mutat.', NULL, '2012-06-07 12:31:27', '2012-06-07 12:31:27'),
(18952, 10088, 'hu', NULL, 'Élénk színű, kézzel festett olajkép, sötét mokka barna fa keretben, pezsgőezüst fényes belső szegéllyel. A festmény kézműves jellege miatt, minden egyes darab finom különbségeket mutat.', NULL, '2012-06-07 12:31:28', '2012-06-07 12:31:28'),
(18953, 10089, 'hu', NULL, 'Texturált, foltos zsálya zöld és aranyszínű képszegéllyel körülvett képek, nehéz szürke mázas, fekete és barna foltos, rézbronz kidolgozású keretekben. A képeket tükör védi.', NULL, '2012-06-07 12:31:28', '2012-06-07 12:31:28'),
(18954, 10090, 'hu', NULL, 'Olajfestmény másolatok, fekete és szürke foltos ezüstözött keretekben, fényes fekete peremekkel. A képek kiemelkednek a tábla síkjából, hogy még figyelemfelkeltőbbek legyenek.', NULL, '2012-06-07 12:31:28', '2012-06-07 12:31:28'),
(18955, 10091, 'hu', NULL, 'Virág képek, barna foltos zsálya zöld keretekben, világosbarna foltos, ezüstözött külső és belső élekkel. A képeket üveg fedi.', NULL, '2012-06-07 12:31:28', '2012-06-07 12:31:28'),
(18956, 10092, 'hu', NULL, 'Szépia tónusú képek, közepes méz árnyalatú, csomós furnér keretekben.', NULL, '2012-06-07 12:31:29', '2012-06-07 12:31:29'),
(18957, 10093, 'hu', NULL, 'Rézszínű, levélmintás, texturált képszegéllyel körülvett festmény, selymes fekete keretben, barna, fekete foltos, aranyozott peremmel és selymes fekete szegélyléccel.', NULL, '2012-06-07 12:31:29', '2012-06-07 12:31:29'),
(18958, 10094, 'hu', NULL, 'Olajfestmény másolatok. A keret fekete és sötét olíva koptatású, repedezett barnás szürke színű, a szegélyléc, sötétbarna foltos, vörösesbarna színű.', NULL, '2012-06-07 12:31:29', '2012-06-07 12:31:29'),
(18959, 10095, 'hu', NULL, 'Kopott barna műbőr képszegéllyel körülvett festmények, barna foltos, selymes arany kidolgozású keretekben. A képeket üveg fedi.', NULL, '2012-06-07 12:31:30', '2012-06-07 12:31:30'),
(18960, 10096, 'hu', NULL, 'Bézsszínű vászon képszegéllyel körülvett grafikák, mahagóni árnyalatú, közepes fa tónusú keretekben és szegélylécekkel. A szegélyléceket barna foltos, paradicsom piros peremek díszítik. A képeket üveg fedi.', NULL, '2012-06-07 12:31:30', '2012-06-07 12:31:30'),
(18961, 10097, 'hu', NULL, 'Szépia tónusú fotók, közepes fa tónusú, csomós furnér keretekben, sötétbarna belső peremekkel. A képeket üveg fedi.', NULL, '2012-06-07 12:31:30', '2012-06-07 12:31:30'),
(18962, 10098, 'hu', NULL, 'Texturált krémszínű és arany foltos szövött képszegéllyel körülvett grafikák fekete fényes keretekben, barna és fekete foltos aranyozott belső peremekkel. A képeket üveg fedi.', NULL, '2012-06-07 12:31:30', '2012-06-07 12:31:30'),
(18963, 10099, 'hu', NULL, 'Krém és világos zeller zöld színű texturált képszegéllyel körülvett festmények, sötét mokkabarna kidolgozású csomós furnér keretekben. A képeket üveg fedi.', NULL, '2012-06-07 12:31:31', '2012-06-07 12:31:31'),
(18964, 10100, 'hu', NULL, 'Arany és téglavörös foltos, texturált képszegéllyel körülvett festmény, nehéz szürke mázas, barna és fekete foltos, aranyozott keretben. A képet üveg fedi.', NULL, '2012-06-07 12:31:31', '2012-06-07 12:31:31');
