(19113, 10249, 'hu', NULL, 'Citromsárga oncidium orchideák szövevényes virágzata egy kerámia cserépben. A cserép repedezett elefántcsont és mély mokkabarna zománcozású.', NULL, '2012-06-07 12:32:15', '2012-06-07 12:32:15'),
(19114, 10250, 'hu', NULL, 'Szoborszerű, cymbidium orchidea levél oszlop, fekete, faragott domborműves, arannyal díszített fém virágtartóban.', NULL, '2012-06-07 12:32:15', '2012-06-07 12:32:15'),
(19115, 10251, 'hu', NULL, 'Tartós földbe ültetett, avokádó gyümölcs fás szárai és levelek, díszes rézbronz patina és erősen antik mázas növénytartóban.', NULL, '2012-06-07 12:32:16', '2012-06-07 12:32:16'),
(19116, 10252, 'hu', NULL, 'Világos cserszínű hortenziák, toll labdák, buja Salal levelek, magas faágak és fácántollak kompozíciója egy fakó gesztenyebarna, faragott domborműves fali tartóban.', NULL, '2012-06-07 12:32:16', '2012-06-07 12:32:16'),
(19117, 10253, 'hu', NULL, 'Földes, őszi színek teljes csokorra: hortenzia, cickafark, bogyók, csodafenyő és zöld levelek; kétrészes, lábakon álló, drót kosárba helyezett virágtartóba rendezve.', NULL, '2012-06-07 12:32:16', '2012-06-07 12:32:16'),
(19118, 10254, 'hu', NULL, 'Mély bordó tűzliliom bimbók és virágok, körte-zöld hortenziákkal egy barna tónusú, fakó örökzöld cserépvázába rendezve.', NULL, '2012-06-07 12:32:17', '2012-06-07 12:32:17'),
(19119, 10255, 'hu', NULL, 'Kényelmesen elrendezett, friss fehér liliomok, mély fa árnyalatú magnólia ágakkal, sötétzöld és barna levelekkel, átlátszó vázában, szintetikus vízzel.', NULL, '2012-06-07 12:32:17', '2012-06-07 12:32:17'),
(19120, 10256, 'hu', NULL, 'Ragyogó fehér lepke orchideák futnak ki egy patinabronz kidolgozású fém fali cserépből. A növények tartós földbe vannak ültetve, látható gyökerekkel.', NULL, '2012-06-07 12:32:17', '2012-06-07 12:32:17'),
(19121, 10257, 'hu', NULL, 'Egzotikus orchideák magas levelei, domború rézbarna medálionokkal díszített, fekete angol doboz virágtartóba ültetve.', NULL, '2012-06-07 12:32:18', '2012-06-07 12:32:18'),
(19122, 10258, 'hu', NULL, 'Csiszolt, rézbronz kidolgozású, kacskaringós, kézzel kovácsolt fém állványba helyezett, kivehető cserépbe ültetett buja és vibráló trópusi levelek.', NULL, '2012-06-07 12:32:18', '2012-06-07 12:32:18'),
(19123, 10259, 'hu', NULL, 'Megőrzi a frissen szedett, természetes, örökzöld lombozat kinézetét és élő cserepes bukszus érzetét kelti, faragott, ősi bronz patinázott cserépbe ültetve.', NULL, '2012-06-07 12:32:19', '2012-06-07 12:32:19'),
(19124, 10260, 'hu', NULL, 'Kopott, rozsdabarna mosásokkal díszített, fekete cserépbe ültetett, tornyosuló természetes sárkány fűzfaágak. Megőrzi a frissen szedett, természetes, örökzöld lombozat kinézetét és élő cserepes bukszus érzetét kelti.', NULL, '2012-06-07 12:32:19', '2012-06-07 12:32:19'),
(19125, 10261, 'hu', NULL, 'Megőrzi a frissen szedett, természetes, örökzöld lombozat kinézetét és művészien metszett élő puszpáng érzetét kelti, rozsdabarna mázas, kopott fekete urnába ültetve.', NULL, '2012-06-07 12:32:19', '2012-06-07 12:32:19'),
(19126, 10262, 'hu', NULL, 'Megőrzi a frissen szedett, természetes, örökzöld lombozat kinézetét és élő cserepes bukszus érzetét kelti. Formára nyesett bokor, faragott mohos kő kidolgozású, terrakotta cserépbe ültetve.', NULL, '2012-06-07 12:32:20', '2012-06-07 12:32:20'),
(19127, 10263, 'hu', NULL, 'Rézbronz díszítésű, fakó fekete virágtartóba ültetett, buja, trópusi osztott levelű filodendronok, állandó talajban.', NULL, '2012-06-07 12:32:20', '2012-06-07 12:32:20'),
(19128, 10264, 'hu', NULL, 'Fiatal bambusz koszorúval körülölelt, buja zöld moha, mohos terrakotta cserépben. Méretek: Kicsi: 15,2x30,5x15,2 cm; Nagy: 20,3x38,1x20,3 cm.', NULL, '2012-06-07 12:32:21', '2012-06-07 12:32:21'),
(19129, 10265, 'hu', NULL, 'Magas vörös frézia, karmazsinvörös hortenziával, arany rizs virággal és gazdag zöld levelekkel körülvéve; egy klasszikus előkelő műalkotással díszített, aranyozott kiemelésekkel gazdagított, fém virágtartóba rendezve.', NULL, '2012-06-07 12:32:21', '2012-06-07 12:32:21'),
(19130, 10266, 'hu', NULL, 'Tartós földbe ültetett, mély bordó tulipánok, antikolt arany, dombornyomott faragvánnyal díszített, kopott fekete-patina cserépbe helyezve.', NULL, '2012-06-07 12:32:22', '2012-06-07 12:32:22'),
(19131, 10267, 'hu', NULL, 'Állandó talajban ültetett, aranybúza tónusú hortenzia virágok salal levelek közé ágyazva, savval maratott patinájú, fémes rézbronz cserépbe helyezve.', NULL, '2012-06-07 12:32:22', '2012-06-07 12:32:22'),
(19132, 10268, 'hu', NULL, 'Állandó talajba ültetett, vegyes levelek, ágak és szemek, mohos bézs kerámia cserépbe helyezve.', NULL, '2012-06-07 12:32:22', '2012-06-07 12:32:22'),
(19133, 10269, 'hu', NULL, 'Állandó talajba ültetett, a papaya és a sárga zamatos árnyalataiban pompázó, élénk foltos Phalaenopsis orchideák, mély-barna fém virágtartóban.', NULL, '2012-06-07 12:32:23', '2012-06-07 12:32:23'),
(19134, 10270, 'hu', NULL, 'Antikolt képekkel díszített, tehén és birka alakú kivágások, fekete hátérrel, és kézzel kovácsolt kopott fekete fém kampókkal. Minden kép 4 kampót tartalmaz.', NULL, '2012-06-07 12:32:23', '2012-06-07 12:32:23'),
(19135, 10271, 'hu', NULL, 'Világosszürke koptatású, rusztikus grafitszürke kidolgozású, kézzel kovácsolt fém keret, enyhén antikolt oldalsó tükrökkel. Vízszintesen és függőlegesen is falra akasztható.', NULL, '2012-06-07 12:32:23', '2012-06-07 12:32:23'),
(19136, 10272, 'hu', NULL, 'Grafikák, téglavörös alapon, erősen kopott fekete keretekben, barna és fekete koptatású, aranybronz belső peremekkel.', NULL, '2012-06-07 12:32:24', '2012-06-07 12:32:24'),
(19137, 10273, 'hu', NULL, 'Kopott festett keretbe foglalt érdekes fürdőszoba képek. A keretek világoszöld, világos kék, fekete és szürke kidolgozásúak, sötétbarna foltos, világoszöld belső peremekkel.', NULL, '2012-06-07 12:32:24', '2012-06-07 12:32:24'),
(19138, 10274, 'hu', NULL, 'Kézi ecsetvonásokkal befejezett olajfestmény másolatok, kopott világoszöld, világoskék, fekete és szürke kidolgozású keretekben, barna foltos világoszöld belső peremekkel.', NULL, '2012-06-07 12:32:24', '2012-06-07 12:32:24'),
(19139, 10275, 'hu', NULL, 'Meleg bézsszínű alapon, puha arany damaszt mintás képszegéllyel körülvett festmények, fényes fekete keretekben, kopott aranybronz peremekkel és hozzá illő szegélylécekkel.', NULL, '2012-06-07 12:32:24', '2012-06-07 12:32:24'),
(19140, 10276, 'hu', NULL, 'Kézi ecsetvonásokkal befejezett olajfestmény másolatok, sötét fa tónusú keretekben, fekete koptatású, aranyozott külső és belső peremekkel.', NULL, '2012-06-07 12:32:25', '2012-06-07 12:32:25'),
(19141, 10277, 'hu', NULL, 'Világosbarna és fekete foltos, 20,3 centiméter széles, ezüstözött keretekbe foglalt madár képek.', NULL, '2012-06-07 12:32:25', '2012-06-07 12:32:25'),
(19142, 10278, 'hu', NULL, 'Színes, kézi ecsetvonásokkal befejezett olajfestmény másolat. A középfa tónusú kemény táblára rögzített és a plusz dimenzió eléréséért abból kiemelkedő kép világosbarna foltos ezüst fényezésű keretben van.', NULL, '2012-06-07 12:32:25', '2012-06-07 12:32:25'),
(19143, 10279, 'hu', NULL, 'Kézi ecsetvonásokkal befejezett olajfestmény másolatok, téglavörös alapon, erősen kopott fekete keretekben, barna és fekete koptatású, aranybronz belső peremekkel.', NULL, '2012-06-07 12:32:26', '2012-06-07 12:32:26'),
(19144, 10280, 'hu', NULL, 'Puha arany díszítésű, meleg bézsszínű képszegéllyel keretezett grafikák, visszafogott szürkészöld mázas, fekete foltos, aranybronz kidolgozású keretekben hozzá illő szegélylécekkel.', NULL, '2012-06-07 12:32:26', '2012-06-07 12:32:26'),
(19145, 10281, 'hu', NULL, 'A keretek lágy, visszafogott zöld, szürke, rózsaszín és levendula tónusúak, szürke mázas, ezüstözött külső és belső peremekkel.', NULL, '2012-06-07 12:32:26', '2012-06-07 12:32:26'),
(19146, 10282, 'hu', NULL, 'Törtfehér vászon képszegéllyel körülvett festmények, fényes fekete kidolgozású fafurnér keretekben, közepes fa tónusú peremekkel és szegélylécekkel.', NULL, '2012-06-07 12:32:26', '2012-06-07 12:32:26'),
(19147, 10283, 'hu', NULL, 'Fakó középbarna, műbőr képszegéllyel körülvett festmény, díszes peremű, fényes fekete keretben, hozzá illő, fekete koptatású bronzszínű szegélyléccel.', NULL, '2012-06-07 12:32:27', '2012-06-07 12:32:27'),
(19148, 10284, 'hu', NULL, 'Erősen avíttas, 25,4 centiméter széles, festett világosszürke natúr fa keret, antikolt pezsgőszínű fém szegéllyel és egy 3 centiméter szélesen metszett tükörrel.', NULL, '2012-06-07 12:32:27', '2012-06-07 12:32:27'),
(19149, 10285, 'hu', NULL, 'Ez a keret nélküli kézzel festett olajkép, fatáblára erősített vászonra készült. A festmény kézműves jellege miatt, minden egyes darab finom különbségeket mutat.', NULL, '2012-06-07 12:32:27', '2012-06-07 12:32:27'),
(19150, 10286, 'hu', NULL, 'Ez a keret nélküli, kézzel festett élénk olajkép, fa keresztfa szövetfeszítőkre erősített vászonra készült. A festmény kézműves jellege miatt, minden egyes darab finom különbségeket mutat.', NULL, '2012-06-07 12:32:27', '2012-06-07 12:32:27'),
(19151, 10287, 'hu', NULL, 'Színes olajfestmény másolattal díszített elragadó írótábla, keki alapon kopott fekete kidolgozású keretben, 6 paprika alku mágnessel.', NULL, '2012-06-07 12:32:28', '2012-06-07 12:32:28'),
(19152, 10288, 'hu', NULL, 'Fémes ezüst pezsgő és ezüstözött díszítésekkel körülölelt, csavart, barázdált felületű üveg lámpa. A kerek harang alakú lámpaernyő selymes pezsgőszínű szövetből készült.', NULL, '2012-06-07 12:32:28', '2012-06-07 12:32:28'),
(19153, 10289, 'hu', NULL, 'Szürke patina gyertyatartó, arany kiemelésekkel, átlátszó üveg burával és bézs gyertyával.', NULL, '2012-06-07 12:32:29', '2012-06-07 12:32:29'),
(19154, 10290, 'hu', NULL, 'Sötét eszpresszó árnyalatú, dombornyomott levél mintás, rozsdabarna, fára feszített szövet keret kopott vörös díszítéssel és 3 centiméter szélesen metszett tükörrel.', NULL, '2012-06-07 12:32:29', '2012-06-07 12:32:29'),
(19155, 10291, 'hu', NULL, 'Enyhén antikolt, natúr bambuszrétegekből és szövött rattanból készült óralap, moha zöld mázzal és kvarc óraszerkezettel.', NULL, '2012-06-07 12:32:29', '2012-06-07 12:32:29'),
(19156, 10292, 'hu', NULL, 'Antik ezüst fényezésű díszes fényképkeretek. Elhelyezhető képek méretei: 10,2x15,2 cm; 12,7x17,8 cm. A keretek méretei: Kicsi: 22,9x27,9x2,5 cm; Nagy: 25,4x30,5x2,5 cm.', NULL, '2012-06-07 12:32:29', '2012-06-07 12:32:29'),
(19157, 10293, 'hu', NULL, 'Mély, lépcsőzetes kialakítású, erősen kopott zabliszt foltos, ültetvényen termesztett, fahéj színű mangófa keret, barnás tónusozással és metszett tükörrel.', NULL, '2012-06-07 12:32:30', '2012-06-07 12:32:30'),
(19158, 10294, 'hu', NULL, 'Elegáns lámpabúra, egymásba fonódott fényes bronzszínű fém rétegek alkotta bonyolult rácsmintával.', NULL, '2012-06-07 12:32:30', '2012-06-07 12:32:30'),
(19159, 10295, 'hu', NULL, 'Világosszürke foltos, sötétbarna kidolgozású asztalok, réz díszítéssel. Méretek: Kicsi: 30,5x68,6x30,5 cm; Nagy: 35,6x76,2x35,6 cm.', NULL, '2012-06-07 12:32:30', '2012-06-07 12:32:30'),
(19160, 10296, 'hu', NULL, 'Kézzel kovácsolt, erősen antikolt aranyszínű fémből készült, dekoratív asztal vörös tónussal és csiszolt élek. Hozzáillő tükör: 13703-es elem.', NULL, '2012-06-07 12:32:31', '2012-06-07 12:32:31'),
(19161, 10297, 'hu', NULL, 'Keret nélküli, olajfestmény másolatok, kifejezetten külső használatra. A műalkotások speciális festékkel, kültéri vászonra készültek.', NULL, '2012-06-07 12:32:31', '2012-06-07 12:32:31'),
(19162, 10298, 'hu', NULL, 'Kopott antik fekete kidolgozású, kézzel faragott, arany díszítésű mangófa keret, metszett tükörrel. Hozzá illő konzolasztal a 25546-os cikk.', NULL, '2012-06-07 12:32:32', '2012-06-07 12:32:32'),
(19163, 10299, 'hu', NULL, 'Pompás, kézzel kidolgozott, kopott antik fekete színű, tömör mangófa keret sötét mézszínű árnyalással és metszett tükörrel.', NULL, '2012-06-07 12:32:32', '2012-06-07 12:32:32'),
(19164, 10300, 'hu', NULL, 'Az oxidálódott fém sokszínű árnyalatával díszített, klasszikus lámpaernyő.', NULL, '2012-06-07 12:32:33', '2012-06-07 12:32:33'),
(19165, 10301, 'hu', NULL, 'Aranybarna és fekete csíkos plüss borítású puff, fekete műbőr oldalkárpittal, fényes bronz gombbal és sötétében színű keményfa lábakkal.', NULL, '2012-06-07 12:32:33', '2012-06-07 12:32:33');
INSERT INTO `product_translations` (`id`, `product_id`, `locale`, `short_description`, `long_description`, `advice`, `created_at`, `updated_at`) VALUES
(19166, 10302, 'hu', NULL, 'Fekete díszszegélyes, aranybarna és fekete csíkos plüss borítású tároló pad légáteresztő és tisztítható fekete műbőr oldalkárpittal. A sötétében színű keményfa lábak és váz egyenként kovácsolt öntött acél szegecsekkel díszített. Az ülőrész felhajtásával praktikus tároló helyet kapunk.', NULL, '2012-06-07 12:32:33', '2012-06-07 12:32:33'),
(19167, 10303, 'hu', NULL, 'Egyeletlen méz színű kidolgozással, festett élénk körte zöld és fekete tónusú süllyesztett felülettel díszített, tömör, ültetvényen termesztett mangófából készült dohányzóasztal, faragott lábakkal és szilárd asztallappal. Előkelő megjelenése a vízbázisú fedőrétegének köszönhető.', NULL, '2012-06-07 12:32:34', '2012-06-07 12:32:34'),
(19168, 10304, 'hu', NULL, 'Keret nélküli, élénk olajfestmény másolatok, kifejezetten külső használatra. A műalkotás speciális festékkel, kültéri vászonra készült. Minden második panel különböző méretű.', NULL, '2012-06-07 12:32:34', '2012-06-07 12:32:34'),
(19169, 10305, 'hu', NULL, 'Meleg gesztenyebarna kidolgozású nyers furnér asztallap, kopott, fa tónusú, kézzel kovácsolt fém vázzal és átlátszó üveg polccal.', NULL, '2012-06-07 12:32:34', '2012-06-07 12:32:34'),
(19170, 10306, 'hu', NULL, 'Sötétszürke mázas, erősen antikolt ezüst pezsgő fényezésű keret, gyöngyös díszítéssel, antik oldalsó és egy 3 centiméter szélesen metszett középső tükrökkel. Vízszintesen és függőlegesen is falra akasztható.', NULL, '2012-06-07 12:32:35', '2012-06-07 12:32:35'),
(19171, 10307, 'hu', NULL, 'Erősen antikolt ezüst pezsgő kidolgozású, kézzel kovácsolt fém órakeret, csiszolt részekkel, erősen antikolt óralappal és kvarc óraszerkezettel.', NULL, '2012-06-07 12:32:35', '2012-06-07 12:32:35'),
(19172, 10308, 'hu', NULL, 'Sötét ébenfa foltos, 17,8 centiméter széles, árnyékdoboz stílusú valódi fa keret, fényes krómozott belső szegéllyel és metszett tükörrel.', NULL, '2012-06-07 12:32:35', '2012-06-07 12:32:35'),
(19173, 10309, 'hu', NULL, 'Barna műbőr kárpitos pihenőágy, kék fonállal szőtt, csokoládé és bézsszínű plüss ülőfelülettel és sötét dió színű tömör fa lábakkal. Ülőmagasság: 50,8 cm.', NULL, '2012-06-07 12:32:36', '2012-06-07 12:32:36'),
(19174, 10310, 'hu', NULL, 'Keki alapon, kopott, repedezett aranyvessző zománcozású kerámia váza.', NULL, '2012-06-07 12:32:36', '2012-06-07 12:32:36'),
(19175, 10311, 'hu', NULL, 'Kopott fa tónusú lámpatest, aranyszínű kiemelésekkel, olíva bronz részekkel és enyhén antikolt tejüveg búrával.', NULL, '2012-06-07 12:32:36', '2012-06-07 12:32:36'),
(19176, 10312, 'hu', NULL, 'Kopott sötét bronz kidolgozású lámpatest, aranyszínű kiemelésekkel és antikolt áttetsző vörös díszítéssel. Az ovális dob lámpaernyő, nyitott szövésű selymes arany barnás szürke színű anyagból készült.', NULL, '2012-06-07 12:32:37', '2012-06-07 12:32:37'),
(19177, 10313, 'hu', NULL, 'Átlátszó üveg lámpatest, fekete forgatott cukor részekkel és fényes krómozott fém díszítéssel. A kerek merev lámpaernyő selymes ezüstszínű szövetből készült.', NULL, '2012-06-07 12:32:37', '2012-06-07 12:32:37'),
(19178, 10314, 'hu', NULL, 'A hagyományos vonások és modern elemek keveredése valódi átmenti érzését kölcsönöz a kollekció összes darabjának.', NULL, '2012-06-07 12:32:37', '2012-06-07 12:32:37'),
(19179, 10315, 'hu', NULL, 'Természetes anyagú, rugalmas, fekete műbőr kárpitozású karosszék, viharvert dió árnyalatú keményfa lábakkal. A rámán varrott díszítésű, magas, íves háttámlát és a plüss ülőrészt, aranyszínű, barna és fekete mintás kárpit borítja. Ülőmagassága: 48,3 cm.', NULL, '2012-06-07 12:32:38', '2012-06-07 12:32:38'),
(19180, 10316, 'hu', NULL, 'Repedezett elefántcsontszínű terrakotta díszek, moha zöld és rozsdabarna kidolgozással.', NULL, '2012-06-07 12:32:38', '2012-06-07 12:32:38'),
(19181, 10317, 'hu', NULL, 'Fényes, krómozott lámpatest, fekete vászon szövetből készült, kerek, merev lámpaernyővel.', NULL, '2012-06-07 12:32:38', '2012-06-07 12:32:38'),
