(19254, 10390, 'hu', NULL, 'Viharvert laminált óralap, öntött réz külső peremmel, réz központi alkatrészekkel és ingával. Az óra egy AA és egy D elemmel működik.', NULL, '2012-06-07 12:33:02', '2012-06-07 12:33:02'),
(19255, 10391, 'hu', NULL, 'Viharvert, laminált óralap, öntött réz külső peremmel és réz központi alkatrészekkel. Az óra egy darab AA és egy darab D elemmel működik.', NULL, '2012-06-07 12:33:03', '2012-06-07 12:33:03'),
(19256, 10392, 'hu', NULL, 'Állítható, teleszkópos állványon lógó, réz zsebóra másolat. 1 darab AA elemmel működik. A tartóállvány magassága 20,3 és 31,8 centiméter között állítható.', NULL, '2012-06-07 12:33:03', '2012-06-07 12:33:03'),
(19257, 10393, 'hu', NULL, 'Állítható, teleszkópos állványon lógó, réz zsebóra másolat. 1 darab AA elemmel működik. A tartóállvány magassága 20,3 és 31,8 centiméter között állítható.', NULL, '2012-06-07 12:33:03', '2012-06-07 12:33:03'),
(19258, 10394, 'hu', NULL, 'Állítható, teleszkópos állványon lógó, nikkelezettt, sárgaréz zsebóra másolat. 1 darab AA elemmel működik. A tartóállvány magassága 20,3és 31,8 centiméter között állítható.', NULL, '2012-06-07 12:33:03', '2012-06-07 12:33:03'),
(19259, 10395, 'hu', NULL, 'Dombornyomott, antikolt alumínium fólia és kézzel kovácsolt fém rúddal összekötött, kézzel faragott fa érmék, újrahasznosított természetes fa deszkalapon. Vízszintesen és függőlegesen is falra akasztható.', NULL, '2012-06-07 12:33:04', '2012-06-07 12:33:04'),
(19260, 10396, 'hu', NULL, 'Kézzel kovácsolt, antikolt fémből készült páfrányokat ábrázoló díszes falitáblák, újrahasznosított természetes fadeszkákon. Vízszintesen és függőlegesen is falra akasztható.', NULL, '2012-06-07 12:33:04', '2012-06-07 12:33:04'),
(19261, 10397, 'hu', NULL, 'Nyugodt festmény bézs és szürke vászon képszegéllyel, sötétbarna és fekete foltos bronz kidolgozású keretben. A képet üveg fedi.', NULL, '2012-06-07 12:33:04', '2012-06-07 12:33:04'),
(19262, 10398, 'hu', NULL, 'Ezüstözött, kortárs lámpa, kézzel festett antikolással és kézzel varrott, téglalap alakú harang szövet lámpaernyővel.', NULL, '2012-06-07 12:33:05', '2012-06-07 12:33:05');
